import React from 'react'
import PropTypes from 'prop-types'

const LogItem = ({log}) => {

    const {id,message,firstName,LastName,tech} = log
    return (
       <li className="collection-item">
            <div className="center">
                <a href="#edit-log-modal" className={`modal-trigger ${log.attention ? 'red-text' : 'blue-text'}`}>{message}</a>
                <br/>
                <span className="grey-text">
                    <span className="black-text">ID #{id}</span>
                    last updated by {}
                    <span className="black-text">{tech}</span>
                </span>
            </div>
       </li>
    )
}

LogItem.propTypes = {
    log: PropTypes.object.isRequired,
}

export default LogItem
